class MapParser():
    EXCLUDED_ENTRIES = ["_prolog", "_epilog", "_unresolved",
                        "_ctors", "_dtors", "__destroy_global_chain_reference", "ModuleProlog", "ModuleEpilog"]
    SECTION_PATTERN = re.compile("^(\.[a-z0-9]+) section layout$")
    LINE_PATTERN = re.compile(
        "^\s+([a-fA-F0-9]{8})\s+([a-fA-F0-9]{6})\s+([a-fA-F0-9]{8})\s+[0-9]+\s+([^\s\$\.\*\@]+)\s+.+$")

    def parse(self, reader: BufferedReader):
        lst = {}
        current_section = None
        lines = reader.readlines()
        for line in lines:
            m = MapParser.SECTION_PATTERN.match(line)
            if not m is None:
                current_section = m[1]
                lst[current_section] = {}
                continue
            m = MapParser.LINE_PATTERN.match(line)
            if not m is None:
                offset, size, address, symbol = int(
                    m[1], 16), int(m[2], 16), int(m[3], 16), re.sub("[^_a-zA-Z0-9]", "_", m[4])
                if not symbol in MapParser.EXCLUDED_ENTRIES:
                    lst[current_section][symbol] = address
        return lst


def main():
    @dataclass
    class ParserArguments():
        list: TextIOWrapper
        output_lst: TextIOWrapper
        map_dir: str
        input_lst: TextIOWrapper
        game_version: str

    def mapDirType(string):
        if not os.path.exists(string):
            raise argparse.ArgumentError(None, "Map dir not found")
        if not os.path.isdir(string):
            raise argparse.ArgumentError(None, "Map dir is not a directory")
        return string

    parser = argparse.ArgumentParser(
        description="Parses '.map' files from main DOL and RELs into an '.lst' file.")
    parser.add_argument("list", type=argparse.FileType(
        "r"), help="Path to a file containing a list of newline separated REL module name to parse.")
    parser.add_argument("map_dir", type=mapDirType,
                        help="Path to the extracted 'maps' folder")
    parser.add_argument(
        "output_lst", type=argparse.FileType("w"), help="Path to the output file")
    parser.add_argument("-i", "--input-lst",
                        type=argparse.FileType("r"), help="Path to a .lst file to start with (priority to this file for entries existing in both this file and the game)")
    parser.add_argument("-g", "--game-version",
                        choices=["gc_us", "gc_pal", "gc_jp", "wii_us0", "wii_pal"], help="Version of the game (defaults to gc_us)", default="gc_us")
    args: ParserArguments = parser.parse_args()

    provided_lst = {}

    # Load the provided lst file (if needed)
    if not args.input_lst is None:
        with args.input_lst as f:
            for line in f:
                m = re.match(r"^\s*(?://.*)?$", line)
                if m:
                    # Comment line, skip
                    continue
                m = re.match(
                    r"^(?:([a-zA-Z0-9]{1,8}),([a-zA-Z0-9]{1,8}),)?([a-zA-Z0-9]{1,8}):([^/\s]+?)(?:\s*//.*)?$", line)
                if m:
                    provided_lst.setdefault(m[4], (0 if m[1] is None else int(
                        m[1], 16), 0 if m[2] is None else int(m[2], 16), int(m[3], 16)))

    rels = dict([(name, id)
                for id, name in RELS[GameVersion[args.game_version.upper()]].items()])

    parser = MapParser()
    lst = provided_lst
    with args.list as l:
        for rel in l.readlines():
            rel = rel.strip()
            if not rel.startswith("//"):
                with open(os.path.realpath(f"{args.map_dir}/{rel}.map"), "r") as file:
                    rel_lst = parser.parse(file)
                    for section, symbols in rel_lst.items():
                        if section in SECTION_IDS.keys():
                            for symbol, offset in symbols.items():
                                lst.setdefault(
                                    symbol, (rels[rel], SECTION_IDS[section], offset))

    with args.output_lst as f:
        f.writelines([f"0x{t[0]:x},{t[1]:d},{t[2]:x}:{name}\n" if t[0] !=
                     0 else f"{t[2]:x}:{name}\n" for name, t in lst.items()])


if __name__ == "__main__":
    main()
